import './App.css';
import React, {useState, useEffect } from "react";
import axios from './axios';



const Browsedogs = () => {

  const res = axios({
    method:'get',
    url: '/dogs',
responsetype: 'json',
headers: {
  'Content-Type':"application/json"
}

  }
  )

    return (
      <div>
     <tr>
                    <th>dog ID</th>
                    <th>name</th>
                    <th>breed</th>
                    <th>location</th>
                    <th>image</th>
                </tr>
                {res.map((item, i) => (
                    <tr key={i}>
                        <td>{item._id}</td>
                        <td>{item.name}</td>
                        <td>{item.breed}</td>
                        <td>{item.location}</td>
                        <td>{item.image}</td>
                    </tr>
                ))}
    </div> 




 );
  }






export default Browsedogs;
